import React from 'react'
import './Navbar.css'

export default function Navbar() {
  return (
    <div className='navbar'>
      <div className="heading"></div>
      
      <div className='action'>
      <div className="action login">Login</div>
      <div className="action signup">SignUp</div>
      </div>
    </div>
  )
}
